				radius = 1.5;
				aiMaxRange = "1.5				 * 3";
				onlyForPlayer = 0;
				condition = "((this animationPhase 'Door_1_rot') < 0.5) && ((this getVariable ['bis_disabled_Door_1',0]) != 1) && (cameraOn isKindOf 'CAManBase')";
